                    <img className="poke-img" src={pokemon.img} width="200px"></img>
                    <p>ID: {pokemon.id}
                    <br />
                    Type: {pokemon.type[0]}
                    <br />
                    Attack: {pokemon.stats.attack}
                    <br />
                    Defense: {pokemon.stats.defense}</p>

                        <a href={`/pokemon/${index}/edit`} className="edit-button"><button>Edit</button></a>
